  false,\n\t\"url\": null,\n\t\"notes\": \"This memorandum discusses the results of
  population estimates for Anaho Island National Wildlife Refuge within the Stillwater
  Wildlife Management Area. The report first gives an introduction to Anaho Island,
  followed by methods for obtaining population counts. Next are the results of the
  study and bird count numbers. Other bird sightings are included as well as aerial
  photographs displaying the locations of nesting colonies. American White Pelican,
  Double-crested Cormorant, Great Blue Heron, California Gull, and Black-crowned Night
  Heron are species discussed.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
